import axios from '../../../conexion';

const Datos= (props)=>{
    var [operaciones,setOperaciones]= useState([]);

    useEffect(()=>{
        cargar()
    })
    
    const cargar= async ()=>{
        var config = {
            method: 'get',
            url: 'http://localhost:3200/api/operation/'+ props.id,
            headers: { 
              'Content-Type': 'application/x-www-form-urlencoded'
            },
        };
        const operation= await axios(config)
        setOperaciones(operaciones,operation.data)
        console.log(operation.data)
    }
    
        return(
            <tbody>
                {
                    operaciones.map(operaciones=>(
                        <tr key={operaciones.id_oper}>
                            <td>{operaciones.concepto}</td>
                            <td>{operaciones.monto}</td>
                            <td>{operaciones.fecha}</td>
                            <td>{operaciones.tipo}</td> 
                        </tr>)
                    )
                }
            </tbody>
        )
    
}

export default Datos;
